import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import "react-router";
import {
  BrowserRouter,
  Route,
  Link
} from 'react-router-dom'
import MemoryGame from "./MemoryGame.js"
import SudokuPuzzleGenerator from "./SudokuPuzzleGenerator.js"
import SudokuPuzzleSolver from "./SudokuPuzzleSolver.js"
import GameStats from "./GameStats.js";


class App extends Component {
  constructor(props) {
    super(props);
  }
  render(){
    return (
      <BrowserRouter>
      <div>
          <div>
              <hr/>
              // <a href="/" ><button>Memory Game</button></a>
              <a href="/memoryGame" ><button>Memory Game</button></a>
              <a href="/generateSudoku" ><button>Sudoku</button></a>
              <a href="/solveSudoku" ><button>Solve Sudoku</button></a>
              <a href="/GameStats" ><button>Game Statistics</button></a>
              <hr/>
          </div>
            <Route exact path="/" component={MemoryGame} />
            <Route
              path='/memoryGame'
              render={(props) => <MemoryGame  />}
            />
            <Route
              path='/generateSudoku'
              render={(props) => <SudokuPuzzleGenerator />}
            />
            <Route
              path='/solveSudoku'
              render={(props) => <SudokuPuzzleSolver/>}
            />
            <Route
              path='/GameStats'
              render={(props) => <GameStats/>}
            />
          </div>
      </BrowserRouter>
   )
 }

}

export default App;
